const Home = () => {
    const location = useLocation();
    const userData = location.state?.user;

    return (
      <div>
        <h1>Welcome to Home Page</h1>
        {userData && (
          <div>
            <p>Name: {userData.name}</p>
            <p>Email: {userData.email}</p>
            <p>Role: {userData.role}</p>
            {/* Display other user details as needed */}
          </div>
        )}
      </div>
    );
  };

  export default Home
